(function ($, window) {
  // HeeJun, Seoul office;
  var whiteList = ['210.94.41.89'];
  $.get('https://api.ipfind.com/me?auth=7fe9ffcc-b476-4e4f-a363-d3a659a31f44', function(data, status) {
      if (!data || whiteList.indexOf(data.ip_address) > -1) {
        return;
      }
      if (data && data.country_code !== 'US' ) {
      var css = ".sp-g-samsung-chatbot-container { " +
                "display: none !important}";
      var style = document.createElement("style");
      style.type = 'text/css';
      if (style.styleSheet){
        style.styleSheet.cssText = css;
      } else {
        style.appendChild(document.createTextNode(css));
      }
      document.getElementsByTagName('head')[0].appendChild(style);
    }
  });


  $(document).ready(function() {
    $('.sp-g-chatbot-star__container__blue').hide();

    function dynamicLoader() {
      $('#nebula_div_btn').attr('style','padding: 0px; right: 0px; top: 50%; border: none; z-index: 987 !important; position: fixed !important; cursor: pointer !important; line-height: 1px !important; margin-top: 55px;');

      $(".sp-g-samsung-chatbot-container").hide();
      if ($('#chatbot_script').length) {
        return
      }
      var script = document.createElement("script");
      script.type = "text/javascript";
      script.src = '/us/smg/etc/designs/samsung/global/samsung-bot/bundle/main.js?version=2.0';
      script.id = 'chatbot_script';
      document.getElementsByTagName("head")[0].appendChild(script);
      var link = document.createElement('link');
      link.rel = 'stylesheet';
      link.type = 'text/css';
      link.href = '/us/smg/etc/designs/samsung/global/samsung-bot/bundle/main.css?version=2.0';
      link.id = 'chatbot_link';
      document.getElementsByTagName('head')[0].appendChild(link);

      var timmer = setInterval(function() {
        if(window.iAdvize && window.iAdvize.navigate) {
          var path = window.location.pathname.replace('/us/', '');
          iAdvize.navigate("/idz_support");
          clearInterval(timmer);
          clearTimeout(timeout);
          timmer = undefined;
        }
      }, 1000);

      var timeout = setTimeout(function() {
        timmer && clearInterval(timmer);
      }, 20000);
    }

    // code block for iAdvize
    window.iAdvizeCallbacks = {
      onChatDisplayed: function() {
        $('.proactive-layer-chat').hide();
        window.idzHideProactive = true;
        $('.sp-g-samsung-chatbot-container').hide();
      }
    };

    document.addEventListener('click', function (e) {
      if (!Element.prototype.matches) {
        Element.prototype.matches = Element.prototype.msMatchesSelector || Element.prototype.webkitMatchesSelector;
      }
      if (!Element.prototype.closest) {
        Element.prototype.closest = function (s) {
          var el = this;
          if (!document.documentElement.contains(el)) return null;
          do {
            if (el.matches(s)) return el;
            el = el.parentElement || el.parentNode;
          } while (el !== null && el.nodeType == 1);
          return null;
        };
      }
      var el = e.target.closest('#idzcontainer');
      if (el && el === document.getElementById('idzcontainer')) {
        e.preventDefault();
        window.chatBotStore = null;
        document.getElementById('text-chat').innerHTML = '';
        window.sessionStorage.clear();
        window.chatbotActiveTab && window.Cookies('chat_switch', '');
      }
    }, true);

    $(".sp-g-samsung-chatbot-container__button").click(dynamicLoader);
    var inEcom = window.location.pathname.indexOf('/us/support/account/order/') > -1;
    if(inEcom) {
      $('.sp-g-samsung-chatbot-container').hide();
    }

    // prevent auto popout in pdp page
    const isPDP = $("#pdp-page").length > 0;
    // store session in cookie SS-5994
    // if (window.sessionStorage && window.sessionStorage.getItem('chat_session') && (window.location.href.indexOf('support/account/order') > -1)) {
    if (window.Cookies.get("chat_session") && !inEcom && !isPDP) {
      // need to disable need help button in us/support/account/order page
      dynamicLoader();
    }
  })

})(jQuery, window);

